	add("crime", "{\"term\":\"crime\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027crimne\u0027 (French \u0027crime\u0027 , from Latin \u0027crimen\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A specific act committed in violation of the law\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The practice or habit of committing crimes\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Crime\u0027\u0027 doesn’t pay\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"criminal acts collectively\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Any great wickedness or sin; iniquity\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Alexander Pop\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"No \u0027\u0027crime\u0027\u0027 was thine, if \u0027tis no \u0027\u0027crime\u0027\u0027 to love\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"That which occasions crime\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Spense\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"the tree of life, the \u0027\u0027crime\u0027\u0027 of our first father\u0027s fall\", \"priority\":10}]}, \"synonyms\":{}}");

	add("crimea", "{\"term\":\"crimea\", \"etymology\":{\"influencers\":[], \"languages\":[\"crimean tatar\", \"English\", \"Italian\"], \"text\":\"Via Italian from Crimean tatar \u0027qırım\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A peninsula which juts southwards out of the Ukrainian mainland (to which it is connected by the ) into the Black Sea and the Sea of Azov\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The , which for much of its history controlled most of the Crimean peninsula and various adjacent areas of the mainland\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1987\u0027\u0027, Robert M. Croskey, \u0027Muscovite Diplomatic Practice in the Reign of Ivan III\u0027, page 96\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"According to Zimin, this individual was in the service of Prince Fedor Vasili\u0027evich Riazanskii as early as 1498, two years after his service on the embassy to the \u0027\u0027Crimea\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1995\u0027\u0027, \u0027Muscovy and Sweden in the Thirty Years\u0027 War 1630-1635\u0027 (ISBN 0521451396), page 7\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"On its return journey in 1633 the Tatar embassy was arrested by the Muscovite government, which was already at war with the \u0027\u0027Crimea\u0027\u0027, and only after several months was it released as a result of an appeal by Sweden\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, Andreas Kappeler, \u0027Die Geschichte Russlands im 16. und 17. Jahrhundert\u0027 (ISBN 3447050292), page 37\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"As late as 1665, the \u0027\u0027Crimea\u0027s\u0027\u0027 demand for continued and increased tribue from Moscow was one of the conditions leading to a peace treaty between a khan and tsar („kaznu v Krym prodolzhat\u0027 prisylat\u0027 s pribyl\u0027iu“). Notwithstanding Moscow\u0027s rhetorical exercises, the Russian government was acutely aware that as long as Russia\u0027s military force remained ineffective against the \u0027\u0027Crimea\u0027\u0027, peace with \u0027\u0027Crimea\u0027\u0027 could only be purchased\", \"priority\":8}]}, \"synonyms\":{}}");

	add("crimen", "{\"term\":\"crimen\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin {{m|la|crīmen||verdict; adultery; crime}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An impediment to marriage in the canon law of the Roman Catholic Church, preventing the marriage of people who had murdered an existing spouse in order to remarry (even without committing adultery\", \"priority\":1}]}, \"synonyms\":{}}");

	add("crimeware", "{\"term\":\"crimeware\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|crime|ware|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Software that performs or facilitates illegal activities\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Harold F Tipton, Micki Krause, \u0027Information Security Management Handbook, Volume 2\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Technical subterfuge schemes plant \u0027\u0027crimeware\u0027\u0027 onto PCs to steal credentials\", \"priority\":3}]}, \"synonyms\":{}}");

