	add("criminalness", "{\"term\":\"criminalness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|criminal|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state or quality of being criminal\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1655\u0027\u0027, w:John Owen John Owen, \u0027Vindiciae Evangelicae\u0027, published in \u0027The Works of John Owen\u0027, (William H. Goold, editor), page 515\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027criminalness\u0027\u0027, rebellion, transgression, the disobedience that is in sin\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1754\u0027\u0027, w:John Sharp(Archbishop of John Sharp, \u0027The Works of the Most Reverend Dr. John Sharp\u0027, volume III, fifth edition\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"There is a great deal of difference as to the \u0027\u0027criminalness\u0027\u0027 of false persuasions upon this account: the same error which one person may hold very pardonably, (as being, without much fault of his own, either through weakness of parts, or prejudice from education, or want or opportunity of knowing better, unavoidably, in a manner, led into it; I say, that very same error,) may be extremely dangerous in other persons, that have better parts\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1896\u0027\u0027, W. S. Harwood, \u0026quot;Constitutional Suffrage for Women,\u0026quot; \u0027North American Review\u0027, vol. 162, no. 474, [http://digital.library.cornell.edu/cgi/t/text/pageviewer-idx?c\u003dnora;cc\u003dnora;q1\u003dcriminalness;rgn\u003dfull%20text;idno\u003dnora0162-5;didno\u003dnora0162-5;view\u003dimage;seq\u003d0638 p. 632] \u0026lt;small\u0026gt;(retrieved 5 Dec 2010)\u0026lt;/small\u0026gt\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The Constitution of the United States permits the suffrage of women. . . . Under it legally constituted women—as to age, freedom from \u0027\u0027criminalness\u0027\u0027, etc.—may vote for all officers from president to township supervisor\", \"priority\":7}]}, \"synonyms\":{}}");

	add("crimination", "{\"term\":\"crimination\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An accusation of wrongdoing, a recriminatio\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1837,\u0027\u0027 William Hickling Prescott, \u0027History of the Reign of Ferdinand and Isabella\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"and when the ambassadors, after a fruitless attempt at negotiation, which evaporated in mutual \u0027\u0027crimination\u0027\u0027 and recrimination, set out on their return to Aragon, they were twice detained\", \"priority\":3}]}, \"synonyms\":{}}");

