	add("crimson", "{\"term\":\"crimson\", \"etymology\":{\"influencers\":[], \"languages\":[\"Arabic\", \"English\", \"Spanish\", \"Persian\", \"pahlavi\", \"Sanskrit\"], \"text\":\"From Spanish from Arabic \u0027قِرْمِز\u0027 from Persian \u0027کرمست\u0027 from Pahlavi from Sanskrit\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A deep, slightly bluish red\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"To my horror I perceived that the yellow blossoms were all dabbled with \u0027\u0027crimson\", \"priority\":2}]}, \"synonyms\":{}}");

	add("cringe", "{\"term\":\"cringe\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\"], \"text\":\"From Middle english (1100-1500) {{m|enm|*crinchen}}, {{m|enm|crenchen}}, {{m|enm|crengen}}, from Old english (ca. 450-1100) {{m|ang|*crencan}}, {{m|ang|*crencgan||to cause to fall, turn}}, from Proto-germanic {{m|gem-pro|*krangijaną||to cause to turn}}, causative of {{m|gem-pro|*kringaną}}, {{m|gem-pro|*krinkaną||to fall}}, from Proto-indo-european {{m|ine-pro|*grenǵʰ-||to twist, wind}}. Cognate with Scots \u0027crenge\u0027 \u0027creinge\u0027 \u0027creenge\u0027 \u0027crienge\u0027 (to cringe, shrug) Related to {{l/en|crinkle}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A posture or gesture of shrinking or recoiling\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"He glanced with a \u0027\u0027cringe\u0027\u0027 at the mess on his desk\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A crick\", \"priority\":3}]}, \"synonyms\":{}}");

