	add("crisis", "{\"term\":\"crisis\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027κρίσις\u0027 (a separating, power of distinguishing, decision, choice, election, judgment, dispute) from \u0027κρίνω\u0027 (pick out, choose, decide, judge)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A crucial or decisive point or situation; a turning point\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An unstable situation, in political, social, economic or military affairs, especially one involving an impending abrupt change\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A sudden change in the course of a disease, usually at which the patient is expected to recover or die\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A traumatic or stressful change in a person\u0027s life\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A point in a drama at which a conflict reaches a peak before being resolved\", \"priority\":5}]}, \"synonyms\":{}}");

