	add("crista", "{\"term\":\"crista\", \"etymology\":{\"influencers\":[{},{}], \"languages\":[\"ancient greek (to 1453)\", \"Latin\", \"Albanian\"], \"text\":\"From Proto-indo-european {{m|ine-pro|*ḱripo-||head or facial hair}}. Cognate with \u0027crinis\u0027 (hair) \u0027crispus\u0027 (curly) Cognate with Albanian \u0027krip\u0027 Confer Ancient greek (to 1453) \u0027κόρση\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The internal compartments formed by the inner membrane of a mitochondrion, where many chemical reactions take place\", \"priority\":1}]}, \"synonyms\":{}}");

