	add("criterion", "{\"term\":\"criterion\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From \u0027criterion\u0027 from Ancient greek (to 1453) \u0027κριτήριον\u0027 (a test, a means of judging) from \u0027κριτής\u0027 (a judge) from \u0027κρίνω\u0027 (i judge) see critic.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A standard or test by which individual things or people may be compared and judged\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Criterion\u0027\u0027 of choice, of decision, of selection\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"author\u003dPaul title\u003d[http://www.economist.com/news/letters/21590879-britain-jfk-assassination-colombia-life-logging-fancy-words Letters: Say it as simply as passage\u003dCongratulations on managing to use the phrase “preponderant \u0027\u0027criterion\u0027\u0027” in a chart (“[http://www.economist.com/news/united-states/21589427-states-are-starting-test-teachers-your-marks On your marks]”, November 9th). Was this the work of a kakorrhaphiophobic journalist set a challenge by his colleagues, or simply an example of glossolalia\", \"priority\":3}]}, \"synonyms\":{}}");

	add("critic", "{\"term\":\"critic\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027critique\u0027 from Latin \u0027criticus\u0027 from Ancient greek (to 1453) \u0027κριτικός\u0027 (of or for judging, able to discern) from \u0027κρίνω\u0027 (i judge)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person who appraises the works of others\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Macaula\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The opinion of the most skilful \u0027\u0027critics\u0027\u0027 was, that nothing finer [than Goldsmith\u0027s \u0027Traveller\u0027] had appeared in verse since the fourth book of the Dunciad\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A specialist in judging works of art\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"One who criticizes; a person who finds fault\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"I. Watt\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"When an author has many beauties consistent with virtue, piety, and truth, let not little \u0027\u0027critics\u0027\u0027 exalt themselves, and shower down their ill nature\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"An opponent\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"an \u0027act\u0027 of criticism\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Alexander Pop\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Make each day a \u0027\u0027critic\u0027\u0027 on the last\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"the \u0027art\u0027 of criticism\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"John Locke, An Essay Concerning Human Understanding, Chapter 21, page 55\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"And, perhaps, if they were distinctly weighed, and duly considered, they would afford us another sort of logic and \u0027\u0027critic\u0027\u0027, than what we have been hitherto acquainted with\", \"priority\":14}]}, \"synonyms\":{}}");

	add("criticalness", "{\"term\":\"criticalness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state or quality of being critical\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1965\u0027\u0027, Michael A. Wallach \u0026amp; Nathan Kogan, \u0027Modes of Thinking in Young Children\u0027, page 9\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Acquiescence may be roughly described as a \u0026quot;yea-saying\u0026quot; tendency, \u0027\u0027criticalness\u0027\u0027 as a \u0026quot;nay-saying\u0026quot; tendency\", \"priority\":3}]}, \"synonyms\":{}}");

	add("criticism", "{\"term\":\"criticism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|critic|ism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of criticising; a critical judgment passed or expressed; a critical observation or detailed examination and review; a critique; animadversion; censure\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The politician received a lot of public \u0027\u0027criticism\u0027\u0027 for his controversial stance on the issue\", \"priority\":2}]}, \"synonyms\":{}}");

	add("critique", "{\"term\":\"critique\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\"], \"text\":\"{{borrowing|fr|critique|lang\u003den}}, from \u0027critica\u0027 () feminine of \u0027criticus\u0027 () see critic.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The art of criticism\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An essay in which another piece of work is criticised, reviewed, etc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"title\u003dIn the Ferguson era, Malcolm X’s courage in fighting racism inspires more than work\u003d date\u003d20 February url\u003dhttp://www.theguardian.com/commentisfree/2015/feb/20/ferguson-malcolm-x-racism-assassination-martin-luther-king-ferguson|passage\u003dI did not always agree with Malcolm X, specifically his \u0027\u0027critiques\u0027\u0027 of Dr King and of the philosophy of nonviolent resistance\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Addiso\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"I should as soon expect to see a \u0027\u0027critique\u0027\u0027 on the poesy of a ring as on the inscription of a medal\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A critic; one who criticises\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Bishop Lincol\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"a question among \u0027\u0027critiques\u0027\u0027 in the ages to come\", \"priority\":8}]}, \"synonyms\":{}}");

